	endpointsEndpoints := &endpoints.Endpoints{
		HTTPHost:  httpHost,
		HTTPProto: httpProto,
	}
	errorCookieDef := webapp2.NewErrorCookieDef()
	appContext := appProvider.AppContext
	config := appContext.Config
	appConfig := config.AppConfig
	httpConfig := appConfig.HTTP
